import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

function UserList(userInfo) {
  const navigate = useNavigate();
  const [userName, setUserName] = useState(userInfo.userProfileId.userName);
  const [userPic, setUserPic] = useState(userInfo.userProfilePicPath);
  const [admin, setAdmin] = useState(userInfo.userIsAdmin);

  return (
    <div>
      <div className="set_admin_user_box">
        <img className="user_pic" src={process.env.PUBLIC_URL + userPic} style={{ margin: "20px", width: "50px", height: "50px" }}></img>
        <div className="user_name">{userName}</div>
        <div className="user_is_admin_box">
          <input type="checkbox" checked={admin !== null ? true : false} />
          <label>관리자</label>
        </div>
      </div>
    </div>
  );
}
export default UserList;
